 (12,'s9ar12','["s9a12"]','Every Day','[1]',NULL,1,'2018-02-27',NULL,'Dedicating this track to all the lonely robots in space.','["Cover art photo - NASA (nasa.gov)"]',NULL,'["youtube:video:hbqMU8nkFNs"]',0,'30233859','//spartalien.bandcamp.com','/track/every-day','//open.spotify.com','/track/3XStzziKE8h0Hzw6cT5OAd'),
 (13,'s9ar13','["s9a13","s9a14","s9a15","s9a16","s9a17","s9a18","s9a19","s9a20","s9a21","s9a22","s9a23","s9a24","s9a25"]','MONOLOG','[1]',NULL,3,'2018-05-13',NULL,'Stereophonic pictures recorded by a brain. A deep dive into the abyss of instincts. A honest and unfiltered output of the feelings from an alien that has lost his star map. Trying to dismantle the potential answers to unanswered questions.Faith. Loss. Nostalgia. Change. Life. Death. For you and them. All of us.','["Recorded, composed, mixed and mastered by SPARTALIEN (spartalien.com) between October 2017 and February 2018.","Speech - Movie \"Plan 9 from Outer Space\" (tracks: 1, 4, 7, 10, 11, 13)","Vocals - Esblendet (track: 11)","Didgeridoo - Esblendet (tracks: 1, 4, 7, 13)"]','["Lots of vibes to Esblendet for... everything. I love you."]',NULL,0,'2581651186','//spartalien.bandcamp.com','/album/monolog','//open.spotify.com','/album/2KnU3c5IXpYtHsdJLYS47D'),
 (14,'s9ar14','["s9a26"]','Searching','[1]',NULL,1,'2018-08-13',NULL,'When you stop satisfying expectations and embrace the beginning of the end.',NULL,NULL,NULL,0,'1571954667','//spartalien.bandcamp.com','/track/searching','//open.spotify.com','/track/0zFZIbuKaLJ0bm9MecHfk0'),
 (15,'s9ar15','["s9a27","s9a28","s9a29","s9a30"]','THE GREAT FILTER','[1]',NULL,2,'2018-08-31',NULL,'When humans get blinded by reality, we must tell them the truth.','["Recorded, composed, mixed and mastered by SPARTALIEN","Speech - Robert Jamison (track: 1)","Speech - John Maynard (track: 2)","Speech - Dr. Carolin Rosin (track: 3)","Speech - Robert Hastings (track: 4)"]',NULL,NULL,0,'3617310353','//spartalien.bandcamp.com','/album/the-great-filter','//open.spotify.com','/album/052gFoANpMCUET2C21MUqh'),
 (16,'s9ar16','["s9a31","s9a32","s9a33","s9a34","s9a35","s9a36","s9a37","s9a38","s9a39","s9a40","s9a41","s9a42","s9a43"]','2358','[1]',NULL,3,'2019-03-13',NULL,'You wander and stumble. Through space and time. Literally. Soul searching and yearning for the one thing nobody has ever seen, but most have felt...Suddenly, something flickers from the glare of your slowly dying flashlight. "That''s not what I''m looking for!", you think. Nonetheless, your ingrained curiosity is stronger...It''s an ancient recording device with some magnetic cassette tapes lying right beside it.; dust-layered, it kind of looks like it was left here on purpose...One tape is still loaded in the recorder deck. "Whatever! It''s 2 minutes to midnight anyway.", you think - and hit the play button.INSERT INTO "audio" ("id","catalogID","audioName","audioRuntime","artistIDs","bandcampID","bandcampHost","bandcampSlug","spotifyHost","spotifySlug") VALUES (1,'s9a1','Continuoduction',396,'[1]','2223569284','//spartalien.bandcamp.com','/track/continuoduction','//open.spotify.com','/track/2Clx7jPmYSA21DbB0FKxUR'),
